syntax = "proto3";

package org.e2eelab.skissm.proto;

option java_package = "org.e2eelab.skissm.proto";
option java_outer_classname = "SupplyOpksResponsePayload";
option java_multiple_files = true;

import "e2ee_address.proto";
import "one_time_pre_key_public.proto";

message supply_opks_response_payload {
  uint32 code = 1;
  string msg = 2;
  e2ee_address user_address = 3;
  repeated one_time_pre_key_public one_time_pre_key_public = 4;
}